css:
atom-workspace .command-toolbar-tooltip {
  position: absolute;
  background-color: black;
  color: white;
  padding: 4px;
  border: 1px solid gray;
  border-radius: 4px;
  z-index: 2000;
}
atom-workspace .command-toolbar {
  font-size: 12px;
  box-shadow: inset 0 -8px 8px -4px rgba(0, 0, 0, 0.15);
}
atom-workspace .command-toolbar .btn {
  height: 20px;
  line-height: 1.7;
  display: block;
  padding: 1px 4px;
}
atom-workspace .command-toolbar .btn.dragging {
  border: 1px solid #0088ff;
}
atom-workspace .command-toolbar .new-btn {
  font-family: 'Octicons Regular';
  font-size: 1.3em;
  font-weight: normal;
  font-style: normal;
  font-variant: normal;
  text-transform: none;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  display: inline-block;
  padding-left: .4em;
  padding-right: .6em;
  color: #9da5b4;
  opacity: .8;
  margin-left: 0.1em;
  border: 1px solid transparent;
  border-radius: 0.2em;
}
atom-workspace .command-toolbar .new-btn:before {
  content: "\f05e";
}
atom-workspace .command-toolbar .new-btn:hover {
  border: 1px solid #181a1f;
  background-color: #3a3f4b;
}
atom-workspace .command-toolbar .new-btn.dragging {
  border: 1px solid #0088ff;
}
atom-workspace .command-toolbar.toolbar-horiz {
  background-image: -webkit-linear-gradient(#21252b, #21252b);
}
atom-workspace .command-toolbar.toolbar-horiz .btn {
  position: relative;
  top: -2px;
  margin-right: 3px;
}
atom-workspace .command-toolbar.toolbar-vert {
  background-image: -webkit-linear-gradient(to right, #21252b, #21252b);
}
atom-workspace .command-toolbar.toolbar-vert .btn {
  margin: 0 2px 3px 2px;
}
